import { styled } from '@mui/material/styles';
import { red } from '@mui/material/colors';


export const Icon = styled('div')(({ theme }) => ({


  padding: theme.spacing(1),

  [theme.breakpoints.up('xs')]:{
    backgroundColor: "#ffffff",
    fontSize:"large"
  }


}));
